  inline Coordinates findClosestPoint(
    const geometry_msgs::msg::PoseStamped & pose,
    const Coordinates & start, const Coordinates & end)
  {
    // Extract the position of the pose
    double px = pose.pose.position.x;
    double py = pose.pose.position.y;

    // Extract the start and end coordinates
    double x1 = start.x;
    double y1 = start.y;
    double x2 = end.x;
    double y2 = end.y;

    // Compute the vector from start to end
    double dx = x2 - x1;
    double dy = y2 - y1;

    // Compute the vector from start to the pose
    double px_dx = px - x1;
    double py_dy = py - y1;

    // Compute the squared length of the line segment
    double line_length_squared = dx * dx + dy * dy;

    // If the line segment is a point, return the start point
    if (line_length_squared == 0.0) {
      return start;
    }

    // Compute the projection factor t
    double t = (px_dx * dx + py_dy * dy) / line_length_squared;

    // Clamp t to the range [0, 1] to ensure the closest point lies on the segment
    t = std::max(0.0, std::min(1.0, t));

    // Compute the closest point on the line segment
    Coordinates closest_point;
    closest_point.x = x1 + t * dx;
    closest_point.y = y1 + t * dy;

    return closest_point;
  }
